def _clone_functional_model(model, input_tensors=None):
    if not isinstance(model, Model):
        raise ValueError('Expected `model` argument to be a `Model` instance, got ', model)

    for layer in model._input_layers:
        layer.build(layer.batch_input_shape)

    input_layers_map = {layer.name: layer for layer in model._input_layers}
    input_layers = []
    if input_tensors is None:
        input_tensors = []
        for layer in model._input_layers:
            input_tensors.append(layer.output)
            input_layers.append(layer)
    else:
        input_tensors = to_list(input_tensors)
        for i, x in enumerate(input_tensors):
            if hasattr(x, '_keras_history'):
                input_layer = x._keras_history[0]
                input_layers.append(input_layers_map[input_layer.name])
            else:
                input_layer = Input(tensor=x)
                input_layers.append(input_layer)
                input_tensors[i] = input_layer.output

    output_tensors = []
    for output_layer in model.outputs:
        output_tensors.append(output_layer.output)

    return Model(input_layers, output_tensors, name=model.name)
